import styled from "styled-components";

export const Button = styled.button`
  border-radius: 20px;
  margin-top: 10px;
  background-color: #2072d7b3;
  max-width: 6000px;
  max-height: 50px;
  min-width: 400px;
  min-height: 50px;
`;

export const ButtonText = styled.h1`
color: #fffffff0;
margin: auto;
font-family: Arial, Helvetica, sans-serif;
`;
